import { useState } from 'react';
import { MoreVert } from "@mui/icons-material";
import { Menu, MenuItem, IconButt } from "@mui/material";

const HeaderMenu = () => {
    const [anchorEl, setAnchorEl] = useState(null);

    const handleClose = () => {
        setAnchorEl(null);
    }

    const handleClick = (e) => {
        setAnchorEl(e.currentTarget);
    }

    return (
        <>
            <IconButton onClick={handleClick}>
                <MoreVert />
            </IconButton>

            <Menu
                anchorEl={anchorEl}  // Fixed typo here
                keepMounted
                open={Boolean(anchorEl)}  // Use Boolean to convert anchorEl to boolean
                onClose={handleClose}
                getContentAnchorEl={null}  // This prop is deprecated; no need to use it
                anchorOrigin={{
                    vertical: 'bottom',
                    horizontal: 'center'
                }}
                transformOrigin={{
                    vertical: 'top',
                    horizontal: 'right'
                }}
            >
                <MenuItem onClick={handleClose}>Profile</MenuItem>
                <MenuItem onClick={handleClose}>My account</MenuItem>
                <MenuItem onClick={handleClose}>Logout</MenuItem>
            </Menu>
        </>
    )
}

export default HeaderMenu;
